import React from 'react';
import SingleQuiz from './SingleQuiz';

function Quizzes({ quizzes }) {
  return (
    <div>
      {quizzes.map(quiz => (
        <SingleQuiz
          key={quiz.id}
          title={quiz.title}
          description={quiz.description}
          created_at={quiz.created_at}
          updated_at={quiz.updated_at}
        />
      ))}
    </div>
  );
}

export default Quizzes;
